				seat4R.render(f5);
				seat4L.render(f5);
				seat5R.render(f5);
				seat5L.render(f5);
				{
					GL11.glPushMatrix();
					GL11.glTranslatef(0, 0, -80);
					GL11.glRotatef((float) -entity.turretYaw,0,1,0);
					GL11.glTranslatef(0, 0, 80);
					chaingun1.render(f5);
					chaingun2.render(f5);
					{
						GL11.glPushMatrix();
						GL11.glTranslatef(0, 15, -80);
						GL11.glRotatef((float) entity.turretPitch,1,0,0);
						GL11.glTranslatef(0, -15, 80);
						chaingun3.render(f5);
						chaingun4.render(f5);
						chaingun5.render(f5);
						chaingun6.render(f5);
						GL11.glPopMatrix();
					}
					GL11.glPopMatrix();
				}
				body1.render(f5);
				body_top1.render(f5);
				body_top2.render(f5);
				wingL1.render(f5);
				wingL2.render(f5);
				wingL3.render(f5);
