					GL11.glPushMatrix();
					GL11.glTranslatef(0, 3.6f, 1);
					GL11.glRotatef((float) (entity.prevangletime + (entity.angletime - entity.prevangletime) * smooth), 0.0F, 1.0F, 0.0F);
					GL11.glTranslatef(0, -3.6f, 1);
